import numpy as np

# 动态规划问题- 判断子序列
# 分成两部门
class Solution:
    def isSubsequence(self, s: str, t: str) -> bool:
        '''
        暴力破解
        判断s中每个字符所在t中的位置
        :param s:
        :param t:
        :return:
        '''
        if len(s) == 0:
            return True
        if len(s) != 0 and len(t) == 0:
            return False
        if len(t) == 1 and len(s) == 1 and s != t:
            return False
        if t == s :
            return True
        if len(t) == 2 and len(s) == 1 and len(t.replace(s, "")) < len(t):
            return True
        l = self.getindex(s[0], t)
        c = []
        for i in range(0, len(s) - 1):
            if len(l) == 0 :
                return False
            t = t.replace(t[l[0]], "", 1)
            c = self.getindex(s[i+1], t)
            if len(c) == 0:
                return False
            if l[0] > c[len(c) - 1]:
                return False
            l = c
        return True

    def isSubsequence2(self, s: str, t: str) -> bool:
        '''

        :param s:
        :param t:
        :return:
        '''
        if s == '':
            return True
        loc = -1
        for i in s:
            loc = t.find(i, loc + 1)
            if loc == -1:
                return False
        return True

    def getindex(self, s: str, t: str):
        re = []
        j = 0
        for i in range(0, len(t)):
            if t[i] == s:
                re.append(i)
                j += 1
        return re

solution = Solution()
s = "pppsppuppppbsppppppppppppppppppppepppppppppppqpupppepppppppppppppppnpppppppcppppppppppppeppppppppppp"
t = ""
gcd = solution.isSubsequence2(s, t)
print(gcd)

